window.bookSummaryJSON = "<p>Being a warrior in a garden is pretty good, but being a necromancer is better.</p> <p>For obvious reasons Sylver preferred warzones to gardens, but aside from the guns, sunlight, and other oddities, there wasn't much to complain about.</p> <p>Not to mention he already had a new ally, a new class, a ton of levels, didn't make all that many enemies, and most importantly, at the end of this he was going to finally find Edmund.</p> <p>The only thing left in his way was a parasitic mass of metal, several nuclear explosions, some sort of giant octopus, a group of creatures that were responsible for this realm's destruction, and the most horrendous tree Sylver had ever had the displeasure to lay his eyes on.</p> <p>Book 4 of this Fantasy LitRPG Series about a reincarnated necromancer growing in power and finding his way in a new world where the rules have changed vastly since he last \"lived.\"</p> <p>About the series: With equal parts humor and dark sorcery action, expect loads of skill progression, deep worldbuilding, and unforgettable characters in this story which had nearly 10 million views on Royal Road. Now completely revised and re-edited for Kindle &amp; Audible.</p>"; 
